import React from "react";
import { Switch, Route } from "react-router-dom";
import Login from "../Login";
import UserList from "../UserList";

function App() {
  return (
    <div className="App">
      <Switch>
        <Route path="/" component={Login} exact />
        <Route path="/user" component={UserList} exact />
      </Switch>
    </div>
  );
}

export default App;
